notes:
Il file contiene il report dei servizi utilizzati dagli utenti attraverso il portale dei servizi demografici online. Il file è in formato .csv e contiene:
- il tipo di servizio richiesto;
- la data;
- se il soggetto richiedente è un intermediario (cioè categorie professionali o associazioni che hanno stipulato apposita convenzione con l'Amministrazione).
